var tname = [];
var timg  = [];

/////////////// [ KONFIGURATION ] ///////////////

// Bilder
//
// Syntax:
// fname.push("teil des threadnamens kleingeschrieben");
// fbnm.push("URL");
//
// Bilder können entweder direkt über ihre URL eingebunden werden
// (z.B. http://www.abload.de/img/3148_b78cr0pus.jpeg), oder als
// base64-kodierter Text eingefügt werden. Ein Encoder ist hier
// http://www.askapache.com/online-tools/base64-image-converter/ zu finden.

tname.push("brunch");
timg.push("data:image/jpeg;base64,");

tname.push("fotogra");
timg.push("data:image/jpeg;base64,");

tname.push("hackfressen");
timg.push("data:image/jpeg;base64,");

tname.push("metal");
timg.push("data:image/jpeg;base64,");

tname.push("handy");
timg.push("data:image/jpeg;base64,");

tname.push("san andreas");
timg.push("data:image/jpeg;base64,");

tname.push("poker");
timg.push("data:image/jpeg;base64,");

tname.push("battlefield");
timg.push("data:image/jpeg;base64,");

tname.push("schöne frauen");
timg.push("data:image/jpeg;base64,");        //[T! A 1888] J-C

tname.push("tour de france");
timg.push("data:image/jpeg;base64,");    //[T! A 1888] J-C

tname.push("auto");
timg.push("data:image/jpeg;base64,");    //Tobulus

/////////////////////////////////////////////////

var links, div, bu, table;

table = document.evaluate(".//a[text()='alle Themen als gelesen markieren']/../../../..", document.body, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null);
links = document.evaluate(".//tr/td/a/b/..", table.singleNodeValue, null, XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE, null);

for (var i = 0; item = links.snapshotItem(i); i++)
{
    for (var j = 0; j < tname.length; j++)
    {
        if (item.textContent.toLowerCase().indexOf(tname[j]) >= 0)
        {
            bu  = item.parentNode;
            div = document.createElement("div");
            
            bu.style.backgroundImage = "url(" + timg[j] + ")";
            
            while (bu.childNodes.length > 0)
            {
                div.appendChild(bu.childNodes[0].cloneNode(true));
                bu.removeChild(bu.childNodes[0]);
            }
        
            div.style.margin = "3px";
            div.style.backgroundColor = "#000";
            
            div.style.borderRadius = "8px";
            div.style.MozBorderRadius = "8px";
            div.style.WebKitBorderRadius = "8px";

            div.style.opacity = 0.7;
            div.style.MozOpacity = 0.7;
            div.style.WebKitOpacity = 0.7;

            bu.appendChild(div);
        }
    }
}
